import React from "react";
import { Link } from "react-router-dom";

const Pais = ({ name, bandera, continente, id }) => {
  return (
    <div>
      <Link to={`/countries/${id}`}>
        <h3>{name}</h3>
        <div>
          <img src={bandera} alt="imagen de bandera" width={10} />
        </div>
      </Link>
      <p>{continente}</p>
    </div>
  );
};

export default Pais;
